			if (ts[1] != "G711u")
			{
				shtml+="<li><a href='javascript:;'  class='cdj1' onclick='onmnudj(this," + ts[0]+ ")'>" + ts[1] + "</a></li>";
			}
			t[i]=ts;
		}
		$("mnudjl").innerHTML=shtml;
	}
}

function rfc(){
	var t= new Array();
	var ts=new Array();
	var shtml="";
	var strsplita=String.fromCharCode(9);
	var strsplitb=String.fromCharCode(16);
	var sc;
	sc=ocx.GetChannelName();
	if (sc !=""){
