					mbc.setStyle('left','120');							
					mba.injectBefore(mbc);
					mbb.injectBefore(mbc);
				}
			},
			'over': function() {
				dropFx.start('0.7');
			},
			'leave': function() {
				dropFx.start('1');
			}						
		});
		var drag = clone.makeDraggable({
			'container':container,
			'droppables': [drop]
		}); // this returns the dragged element
