function reps(str){
	var strReg1 =/"/g;
	var strReg2=/'/g;
	var strReg3=/</g;
	var strReg4=/>/g;
	var strReg5=/&/g;
	var ret=str.replace(strReg5, "&amp;");
 	ret=ret.replace(strReg1, "&quot;");
	ret=ret.replace(strReg2, "&acute;");
	ret=ret.replace(strReg3, "&lt;");
	ret=ret.replace(strReg4, "&gt;");
	return ret;
}

